import React from "react";
import "./header.box.style.scss";
import Hot from "../hot/hot.component";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faFacebook,
  faTelegram,
  faTwitter,
  faLinkedin,
} from "@fortawesome/free-brands-svg-icons";

const facebook = <FontAwesomeIcon icon={faFacebook} />;
const telegram = <FontAwesomeIcon icon={faTelegram} />;
const Twitter = <FontAwesomeIcon icon={faTwi} />;

const HeaderBox = () => {
  const HandleClick = () => {
    return <Hot />;
  };
  return (
    <div className='headerBox'>
      <div className='left'>
        <h2>UNBOX</h2>
        <p>
          WALKING <span>TO</span> THE <br />
          <span>SPOTLIGHT</span> WITH <br />
          EASE.
        </p>
        <button onClick={HandleClick}>Get Started</button>
      </div>

      <div>
        <h4>Unbox</h4>
        <a href="http://hh"></a>
      </div>
    </div>
  );
};

export default HeaderBox;
